import React from 'react';
import { Row, Col } from 'antd';
import styled from "styled-components";


const HeaderRow = styled(Row)`
    height : 50px;
    color : #fff;
    background-color : #202020;
`;

const AppHeader = () => {
    return (
        <Row>
            <Col span={4}>LEFT</Col>
            <Col span={16}>CENTER</Col>
            <Col span={4}>RIGHT</Col>
        </Row>

    );
}

export default AppHeader;
